description:
A Park for All Seasons from Above

Nature Documentary hosted by Al Kussin, published by Oasis HD in 2013 - English narration


Information
------------------------------

Get a bird's-eye view of the world's most stunning National and Provincial Parks by soaring high above arctic tundra, through towering mountain ranges, and pristine forests. From up in the air see nature's beauty from a whole new perspective.

